import React, {Components} from "react";
import {connect} from "react-redux";
import "./Search.css";

class Search extends Components{


  render() {
    return (
      <>
        <div>
          <input type={"text"} className={"input"} value={""}/>
        </div>
      </>
    )
  }
}

export default connect(
  state => ({
    posts: state.posts,
    currentPageTable: state.currentPageTable,
  }),
  dispatch => ({
    onAddRedux: (item) => {
      dispatch({type: 'ADD_TO_REDUX', data: item})
    },
    onAddCurrentPageTable: (item) => {
      dispatch({type: 'SAVE_CURRENT_PAGE', data: item})
    }
  })
)(Search);
